import React from 'react';
import styled from 'styled-components';

const Footer = () => {
 
    const Footer = styled.footer`
     width: 100%;
     background: #131313;
     color: #fff;
     text-align: center;
     font-size: 1rem;
    `

  return (
  <>
  <Footer>Created by Madalina Martiniuc  2022</Footer>
  </>
  );
};

export default Footer;
